    "2016-07-27T23:04:40.364161",nt"name": "2015-black-tailed-prairie-dog-inventory-at-the-rocky-mountain-arsenal-national-wildlife-re",nt"isopen":
    false,nt"url": null,nt"notes": "Restoration of short- and mixed-grass prairie
    is considered to be of primary importance at RMANWR. However, the substantial disturbance
    that occurred on the site has created conditions leading to high prairie dog populations,
    conflicting with larger goals for grassland restoration (FWS 2013a). RMANWR has
    designated 2,585 acres as prairie dog habitat management zones (16% of the total
    refuge) in order to promote successful native prairie restoration and ecological
    balance (FWS 2013a, FWS 2013b).  An inventory of black-tailed prairie dogs was initiated
    in 2014 and continued in 2015 with the following objectives: 1) to establish a baseline
    for prairie dog populations on the refuge for future management, and 2) to ensure
    a sufficient prairie dog density to support the reintroduction of black-footed ferrets
    (Mustela nigripes).The reintroduction of black-footed ferrets onto RMANWR has been
    a high priority for the Regional Director of the Mountain Prairie Region for fiscal
    years 2014 and 2015 (FWS 2013c,FWS 2014b).  In order for the reintroduction of black-footed
    ferrets onto RMANWR to be considered a success, the population will have to persist
    for 3 years (FWS 2014c). A major factor to ensure the durability of the ferrets
    is a reliable source of prey, which includes the black-tailed prairie dog.The prairie
    dog density of all management zones averaged 19.74 PD/acre (Table 2). The density
    ranged from 15.00 PD/acre in the Southwest Zones to 24.38 PD/acre in the Southern
    Zones. The established prairie dog management zones can provide suitable prairie
    dog populations for approximately 42 black-footed ferret families.",nt"license_title":
